window.bookSummaryJSON = "<p><i>The Dark Path</i> is considered Isaac Weishaupt's magnum opus; a result of many years delving into the recesses of occult dogma from the approach of open-minded rationalism. Isaac's journey started with an attempt to separate religion from conspiracy theories, but the agenda clearly showed a connection. The question to be considered is if the agenda of the Illuminati overlaps with the tenets of the occult and whether or not there is an evil influence at play. </p> <p>Using cited references to occult literature from the likes of Aleister Crowley, Helena Blavatsky, Kenneth Grant, Jack Parsons, and Alice Bailey, Isaac provides a fundamental exploration of the occult belief system and alternate version of history. </p> <p>Utilizing familiar examples from pop culture, film, music, and television, Isaac proves the Illuminati agenda to steer humanity down a path of Luciferianism by inserting symbolism that speaks to, and manipulates, our subconscious minds. Demonstrations of occult symbols, predictive programming, and ritual magick concepts will be evident as the listener sees the connections made between Disney, The Beatles, Star Wars, Rihanna, Led Zeppelin, Jay-Z, Katy Perry, HBO's Westworld, Harry Potter, Batman, and many more! </p> <p>This work carves out a distinction between witches, satanists, magicians, occultists, and the New Age, while proving the connected desires to usher in Crowley's Aeon of Horus as the New World Order. Isaac uses concepts from Gnosticism, Freemasonry, Alchemy, Kabbalah, and ceremonial magick to explain the symbolism in our entertainment. </p> <p>Transhumanism and the alchemical pursuit of immortality is the pillar to our future as NASA, Nazis, and Ancient Alien theorists use evolution to assert the superiority of alien life forms. The Illuminati savior of Lucifer is revealed, as well as his desire to put us into the digital matrix. </p> <p>\"The religion of the ancients is the religion of the future.\" -Helena Blavatsky </p>"; 
